<!-- PDF export customization -->
<script>
  $(function () {
    // Puedes reemplazar esta imagen por la tuya propia en formato Base64
    var logoBase64 = 'data:image/png;base64,'; // Reemplaza con tu imagen

    $("#example1").DataTable({
      "responsive": true,
      "lengthChange": false,
      "autoWidth": false,
      "buttons": [
        "copy",
        "csv",
        "excel",
        {
          extend: 'pdfHtml5',
          text: 'PDF',
          customize: function (doc) {
            // Insertar el logo al principio del PDF
            doc.content.splice(0, 0, {
              margin: [0, 0, 0, 12],
              alignment: 'center',
              image: logoBase64,
              width: 100
            });

            // Pie de pgina personalizado
            doc.footer = function (currentPage, pageCount) {
              return {
                columns: [{
                  text: 'Todos los derechos reservados por ESTEBAN AULESTIA estudiante del ITSI.',
                  alignment: 'center',
                  margin: [0, 10, 0, 0],
                  fontSize: 8
                }]
              };
            };
          }
        },
        "print",
        "colvis"
      ]
    }).buttons().container().appendTo('#example1_wrapper .col-md-6:eq(0)');
  });
</script>

